import React from 'react'

const Searchbar = () => {

    return (
        <div>
            <input style = {Inputbar} placeholder="Search"/>
                <select style = {Categorybar} title="Cat" placeholder="Categories">
                <option value="grapefruit">Categories</option>
                </select>
        </div>
    )
}
 
const Inputbar = {
    height: '2rem',
    width: '20rem',
    textAlign: 'center'
}
const Categorybar = {
    height: '2.4rem',
    width: '10rem'
}
export default Searchbar
